import React from 'react';

let timerForm = (props) => {
    return (
        <form className= "TimerForm">
                            <span>                
            <label styles='inline'>
            </label>
            <div>
                    Work Time:
                <input type="number" required
                       name="workTime"
                       value={props.workTime}
                       onChange={props.handleChange}/>
                <label> min</label>
                </div>
                </span>
        </form>
    )
}

export default timerForm;
